import React from 'react';
import './Home.css';

const Home = () => {
    return (
        <div className="home-container">
            <header className="home-header">
                <h1>Welcome to the Library System</h1>
                <p>Your gateway to a world of knowledge and information</p>
            </header>
            <section className="home-content">
                <div className="home-card">
                    <h2>Register</h2>
                    <p>Create an account to start accessing our vast collection of books.</p>
                    <a href="/register" className="home-button">Register</a>
                </div>
                <div className="home-card">
                    <h2>Login</h2>
                    <p>Already have an account? Log in to continue.</p>
                    <a href="/login" className="home-button">Login</a>
                </div>
                <div className="home-card">
                    <h2>Explore Books</h2>
                    <p>Browse our collection and find your next great read.</p>
                    <a href="/books" className="home-button">Browse Books</a>
                </div>
            </section>
        </div>
    );
};

export default Home;
